package com.tiankui.reactService.entity;

import java.util.Date;

public class DateInterval {
	private Date startDate;
	private Date endDate;
	private String cliqueName;
	private String count;
	public DateInterval() {
		super();
		// TODO Auto-generated constructor stub
	}
	public DateInterval(Date startDate, Date endDate, String cliqueName, String count) {
		super();
		this.startDate = startDate;
		this.endDate = endDate;
		this.cliqueName = cliqueName;
		this.count = count;
	}
	public Date getStartDate() {
		return startDate;
	}
	public void setStartDate(Date startDate) {
		this.startDate = startDate;
	}
	public Date getEndDate() {
		return endDate;
	}
	public void setEndDate(Date endDate) {
		this.endDate = endDate;
	}
	public String getCliqueName() {
		return cliqueName;
	}
	public void setCliqueName(String cliqueName) {
		this.cliqueName = cliqueName;
	}
	public String getCount() {
		return count;
	}
	public void setCount(String count) {
		this.count = count;
	}
	@Override
	public String toString() {
		return "DateInterval [startDate=" + startDate + ", endDate=" + endDate + ", cliqueName=" + cliqueName
				+ ", count=" + count + "]";
	}
	
}
